import logo from './logo.svg';
import './App.css';
import axios from 'axios';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <input type={"button"}
          className="App-link" value={"api"}
          onclick={axios.post('/api/api_test', {data:"test"})
            .then(result => {
                console.log('success')
            })
            .catch(error => {
                console.log('error')
            })
          }
        >
        </input>
      </header>
    </div>
  );
}

export default App;
